ProcessDefinition.instruction:
Processo FLUIG para acompanhamento da contratação de credenciado, regras básicas:
1 - para solicitações DITEC, deve passar por homologação de uma gerencia técnica;
2 - para solicitações menores que 50% do valor de limite para licitação, o gerente autoriza e é assinado pelo proprio junto com um preposto;
3 - para solicitações entre 50% e 100%, o preposto autoriza e a assinatura continua sendo dele com o gerente do solicitante;
4 - para solicitações acima de 100%, o diretor da área autoriza e a assinatura ocorre en conjunto com o DISUP.
OBS: após a concordância do gerente é gerado um comprometimento no RM.

ProcessState.instruction:
1 - Após gerar  carta contrato, o anexo ocorrerá neste processo ao clicar no cheklist no final do formulário, junto com os demais documentos necessários; 
2- Preencher o formulário com todas as informações;
3 - o comprometimento ocorrerá após concordância do Superior;

